'use strict';
let PriceHistoryItem = require('./PriceHistoryItem.js');
class PriceHistoryItemBuilder extends PriceHistoryItem {
    setDate(value) {
        this.date = value;
    }
    setBidOpen(value) {
        this.bidOpen = value;
    }
    setBidClose(value) {
        this.bidClose = value;
    }
    setBidHigh(value) {
        this.bidHigh = value;
    }
    setBidLow(value) {
        this.bidLow = value;
    }
    setAskOpen(value) {
        this.askOpen = value;
    }
    setAskClose(value) {
        this.askClose = value;
    }
    setAskHigh(value) {
        this.askHigh = value;
    }
    setAskLow(value) {
        this.askLow = value;
    }
    setVolume(value) {
        this.volume = value;
    }
    build() {
        return this;
    }
}
module.exports = PriceHistoryItemBuilder
